s dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"120471","type":"Paragraph"},{"attributes":{},"id":"120306","type":"Selection"},{"attributes":{},"id":"120491","type":"Selection"},{"attributes":{},"id":"120322","type":"LinearScale"},{"attributes":{"label":{"value":"60% do valor Normal"},"renderers":[{"id":"120437"}]},"id":"120465","type":"LegendItem"},{"attributes":{"dimension":"height","line_dash":[6],"line_width":0.5,"location":1591574400000.0},"id":"120308","type":"Span"},{"attributes":{},"id":"120241","type":"UnionRenderers"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"render_mode":"css","right_units":"screen","top_units":"screen"},"id":"120338","type":"BoxAnnotation"},{"attributes":{},"id":"120353","type":"DatetimeTickFormatter"},{"attributes":{},"id":"120158","type":"DataRange1d"},{"attributes":{"axis_label":"Data de Notifica\u00e7\u00e3o (Ano de 2020)","formatter":{"id":"120195"},"major_label_orientation":1.2,"ticker":{"id":"120311"}},"id":"120166","type":"DatetimeAxis"},{"attributes":{},"id":"120164","type":"LinearScale"},{"attributes":{"data":{"x":{"__ndarray__":"AAAAJ04Zd0IAAMCMoBl3QgAAgPLyGXdCAABAWEUad0IAAAC+lxp3QgAAwCPqGndCAACAiTwbd0IAAEDvjht3QgAAAFXhG3dCAADAujMcd0IAAIAghhx3QgAAQIbYHHdCAAAA7Codd0IAAMBRfR13QgAAgLfPHXdCAABAHSIed0IAAACDdB53QgAAwOjGHndCAACAThkfd0IAAEC0ax93QgAAABq+H3dCAADAfxAgd0IAAIDlYiB3QgAAQEu1IHdCAAAAsQchd0IAAMAWWiF3QgAAgHysIXdCAABA4v4hd0IAAABIUSJ3QgAAwK2jIndCAACAE/Yid0IAAEB5SCN3QgAAAN+aI3dCAADARO0jd0IAAICqPyR3QgAAQBCSJHdCAAAAduQkd0IAAMDbNiV3QgAAgEGJJXdCAABAp9sld0IAAAANLiZ3QgAAwHKAJndCAACA2NImd0IAAEA+JSd3QgAAAKR3J3dCAADACcond0IAAIBvHCh3QgAAQNVuKHdCAAAAO8Eod0IAAMCgEyl
